use serde_json::Value;

async fn synthesize_audio(text: &str) -> Result<Vec<u8>, Box<dyn std::error::Error>> {
    let client = Client::new();
    let response = client
        .post("https://api.eleven-labs.com/synthesis")
        .json(&serde_json::json!({
            "voice": "en-US",
            "text": text
        }))
        .header("Authorization", "Bearer YOUR_API_KEY")
        .send()
        .await?
        .json::<Value>()
        .await?;

    let audio_data = response["audio_data"].as_str().unwrap();
