}

void handle\_message(local\_id from, Message \*received) {
 switch (received->s\_header.s\_type) {
 case CS\_REQUEST: {
 Message response = createMessage(MESSAGE\_MAGIC, 0, 0, 0, CS\_REPLY);
 Info new\_info;
 new\_info.id = from;
 new\_info.time = received->s\_header.s\_local\_time;
 push(new\_info);
 fprintf(EventsLog, "%d: process %i CS\_REQUEST from %i\n",time\_clock, id, from);
 fflush(EventsLog);
 send(&id, from, &response);
 break;
 }
 case CS\_REPLY: {
 set\_reply(from);
 fprintf(EventsLog, "process %i CS\_REPLY from %i\n", id, from);
 fflush(EventsLog);
 break;
 }
 case CS\_RELEASE: {
 if (queue.info[0].id == from) {
 pop();
 }
 fprintf(EventsLog, "process %i CS\_RELEASE from %i\n", id, from);
 fflush(EventsLog);
 break;
 }
 case DONE: {
 set\_done(from);
 fprintf(EventsLog, "process %i DONE from %i", id, from);
 fflush(EventsLog);
 }
 default: {
 break;
 }
 }
}

